import React from "react";
import styled from "styled-components";
import TodoItem from "./TodoItem";

const StyleTodo = styled.div`
    border: 1px solid red;
    width: 800px;
    height: 1000px;
    margin: auto;
    margin-top: 150px;
`;

const Input = styled.form``;

const Todo = () => {
    return (
        <StyleTodo>
            <div>
                <Input>
                    <input></input>
                    <button>Enter</button>
                </Input>
                <div>
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                </div>
            </div>
        </StyleTodo>
    );
};

export default Todo;
